import React from 'react'
import './Navbar.css'

const Navbar = () => {
  return (
    <div>
        <div className="n-wrapper">
            <div className="n-left">
                <div className="n-nmae">Sattyam</div>
                <span>Toggle</span>
            </div>
        </div>
    </div>
  )
}

export default Navbar;
